"use strict";function nextWord(){var n=document.getElementById("TryThisWord"),t=document.getElementById("WordPronounce"),r=document.getElementById("WordImage");fetch("/nextword?prev="+n.innerHTML).then(function(e){return e.json().then(function(e){n.innerHTML=e.word.toUpperCase(),t.innerHTML=e.pronounce,r.src=e.image?e.image:""})})}